import React, { Component } from 'react';

class CaculateBtn extends Component {
  constructor(props) {
    super(props)
    this.state = {}
    const caculatorBtnTextArray = ['7','8','9','+','4','5','6','-','1','2','3','X','C','0','=','%']
  }



  render() {
    return (
      <div className="caculateBtnStyle">
        {this.caculatorBtnTextArray.map} 
      </div>
    )
  }

}

export default CaculateBtn;
